import interior1 from "../../assets/images/interior/1.jpg";
import interior2 from "../../assets/images/interior/2.webp";
import interior3 from "../../assets/images/interior/3.jpg";
import Carousel from "../UI/Carousel/Carousel";

const Main_Page = () => {
  return (
    <>
      <Carousel />
      <div className="main__page">
        <div className="rest__title">
          <p>Mary SMILE</p>
        </div>
        <div className="interior__first">
          <img className="img" src={interior1} alt="not found" />
          <div className="interior__second">
            <img src={interior2} alt="not found" />
            <img src={interior3} alt="not found" />
          </div>
        </div>
        <div className="point__title">
          <p>Наші Заклади</p>
        </div>
        <div className="address__list">
          <p>Вул. Велика Васильковська 11</p>
          <p>Вул. Срібна 1А</p>
          <p>Вул. Перемоги 33А</p>
          <p>Вул. Верхній Вад 3</p>
          <p>Вул. Академіка Корольова 7А</p>
          <p>Вул. Півеічна 33А</p>
          <p>Вул. Львівстка 12</p>
        </div>
      </div>
    </>
  );
};

export default Main_Page;
